import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import {BrowserRouter, Route} from 'react-router-dom';

function App() {
  return (

    <BrowserRouter>
      <div className="App">
        <Layout/>
      </div>
    </BrowserRouter>

  );
}

export default App;
